import React from 'react';
import { Bar } from 'react-chartjs-2';

import {
    Chart as ChartJS,
    BarElement,
    CategoryScale,
    LinearScale,
    Tooltip,
    Legend
} from 'chart.js';

ChartJS.register(
    BarElement,
    CategoryScale,
    LinearScale,
    Tooltip,
    Legend
)

const Graph = ({chartData}) => {

    const data = {
        labels: ['A', 'B', 'C','D','F'],
        datasets: [
            {
                label: 'Grade Distribution',
                data: [chartData.A,6,9],
                backgroundColor: 'blue',
                borderColor: 'black',
                borderWidth: 1,
            }
        ]
    }

    const options = {};

    return <Bar data={data} options={options} />;

};

export default Graph;
